import { Route, Routes } from "react-router-dom";
import "./App.css";
import Header from "./components/Header";
import Swap from "./components/Swap";
import Tokens from "./components/Tokens";
import { useConnect,useAccount } from "wagmi";
import{MetaMaskConnector} from "wagmi/connectors/metaMask"

function App() {
const {address,isConnected} = useAccount()
const {connect} = useConnect({connector: new MetaMaskConnector()})
  return <div className="App" connect={connect} isconnected={isConnected} address={address}  ><Header/>
  <Routes className="mainWindow" >
<Route path="/" element={<Swap isConnected={isConnected} address={address}/>} ></Route>
  <Route path="/tokens" element={<Tokens/>}></Route> </Routes>
  </div>;
}

export default App;
